#Matt Person
#Rosalind Problem: LGIS
#source
'''Given: A positive integer n≤10000 followed by a permutation π of length n.
Return: A longest increasing subsequence of π, followed by a longest decreasing subsequence of π.'''

from itertools import combinations

class LGIS:
    def __init__(self,permutation_n):
        self.increasing_cache = {}
        self.longest_increasing_subsequence = self.get_longest_increasing_subsequence(permutation_n)
        self.longest_decreasing_subsequence = self.get_longest_decreasing_subsequence(permutation_n)

    def get_subsequences_with_length_n(self,sequence,n):
        return list(combinations(list(sequence),n))


    #algorithm taken from RosettaCode
    def get_longest_increasing_subsequence(self,X):
        """Returns the Longest Increasing Subsequence in the Given List/Array"""
        N = len(X)
        P = [0] * N
        M = [0] * (N + 1)
        L = 0
        for i in range(N):
            lo = 1
            hi = L
            while lo <= hi:
                mid = (lo + hi) // 2
                if (X[M[mid]] < X[i]):
                    lo = mid + 1
                else:
                    hi = mid - 1

            newL = lo
            P[i] = M[newL - 1]
            M[newL] = i

            if (newL > L):
                L = newL

        S = []
        k = M[L]
        for i in range(L - 1, -1, -1):
            S.append(X[k])
            k = P[k]
        return S[::-1]

    #modified from increasing method from rosetta code
    def get_longest_decreasing_subsequence(self, X):
        """Returns the Longest Increasing Subsequence in the Given List/Array"""
        N = len(X)
        P = [0] * N
        M = [0] * (N + 1)
        L = 0
        for i in range(N):
            lo = 1
            hi = L
            while lo <= hi:
                mid = (lo + hi) // 2
                if (X[M[mid]] > X[i]):
                    lo = mid + 1
                else:
                    hi = mid - 1

            newL = lo
            P[i] = M[newL - 1]
            M[newL] = i

            if (newL > L):
                L = newL

        S = []
        k = M[L]
        for i in range(L - 1, -1, -1):
            S.append(X[k])
            k = P[k]
        return S[::-1]


    #Used in debugging purposes to verify sequence is decreasing
    def is_sequence_decreasing(self,sequence):
        prev = 10001
        for i in sequence:
            if prev <= i:
                return False
            prev = i
        return True

    #Used in debugging purposes to verify sequence is increasing
    def is_sequence_increasing(self,sequence):
        if tuple(sequence) in self.increasing_cache.keys():
            return self.increasing_cache[sequence]
        prev = -1
        for i in sequence:
            if prev >= i:
                self.increasing_cache[tuple(sequence)] = False
                return False
            prev = i
        self.increasing_cache[tuple(sequence)] = True
        return True

